A doomed airliner heads nose-down to the earth. Until mild mannered Clark Kent quietly pushes past the mayhem to the back of the plane, tears off his business suit and becomes Superman, holding the plane aloft by its damaged wing and safely escorting it back to the ground. It's Vivid's latest Superhero spectacular, Superman XXX: A Porn Parody! With all the adventure, excitement you always enjoyed, and all the sex you ever imagined. With the hottest Lois Lane ever, doing things Lois never dreamed of, and villains like evil Alexis Texas and Zoe Voss at every turn! With the crime-fighting only stopping for three-ways, anals, and pounding galore! It's the hit-making team who brought you the biggest parody of 2010, taking on the man of steel and his tool of steel...in Superman XXX: A Porn Parody!
